		Document document = Document.findByUuid(uuid)

		log.info("Downloading url assoc with Document:${uuid}")

		if(document != null && document.url?.toLowerCase().startsWith("http")){
			// Redownload
			HttpResponse response

			if(document.url?.toLowerCase().startsWith("https")){
				response = requestService.executeSSLGet(document.url, null, null, 0)
			}else if(document.url?.toLowerCase().startsWith("http")){
				response = requestService.executeGet(document.url, null, 0)
			}else{
				log.error("Missing protocol for url:${document.url}")
			}

			// If successful
			if(response != null && response?.getStatusLine()?.getStatusCode() == HttpStatus.SC_OK){
				HttpEntity entity = response.getEntity()

				File file = extractTransferLoadService.createFile(entity)

				if(file != null && file.exists()){
					log.info("File downloaded successfully")

					try{
						PutObjectResult result = amazonWebService.s3Upload(document.uuid, file)

						if(result == null){
							log.error("AWS S3 upload result is null for Document:${document.uuid}")
						}
					}catch(Exception e) {
						log.error("Could not upload document: ${document.get("uuid")} to AWS S3" + e)
					}
				}else{
					log.info("Could not download file")
				}
			}else{
				log.info("Response to redownload Document:${uuid} was a failure")
			}
		}

		log.info("Finished fully updating missing documents")
